import React from 'react';

const About = () => {
    return (
        <section className="about-section">
            <div className="container">
                <h3>Why Web Injaz framework ?</h3>
                <p>As all programmers know, the designing process is the most annoying and time consuming process <strong>Web Injaz</strong> framework offer two main featuers:</p>
                <ul>
                    <li><strong>Shapes:</strong>  Built-in styles for the components that you want to use.</li>
                    <li><strong>Backgrounds:</strong>  Css classes that make you create a website with your own set of colors by just changing the class name.</li>
                </ul>
                <p>And it is pure Css</p>
            </div>
        </section>
    );
};

export default About;
